import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://image.freepik.com/free-vector/virus-epidemic-global-pandemic-concept-modern-purple-colors-flat-illustration-coronavirus-symbol-circle-stop-sign-isolated-white-background-covid-19-text_174479-14.jpg" />
      </header>
    </div>
  );
}

export default App;
